import React from 'react';

import styles from './../Style/Components/Content.module.css';

import Editor from './Editor';
import Messages from './Messages';

type MyProps = { Active: { Name: string, SID: string } };
type MyState = { Active: { Name: string, SID: string } };
class Content extends React.Component<MyProps, MyState> {
  public state: MyState;
  constructor(props) {
    super(props);
    this.state = {
      Active: this.props.Active
    }
  }
  render() {
    return (
      <section className={styles.Container}>
        <div className={styles.Top}>
          <picture className={styles.Icon}>
            <img 
              className={styles.Icon_IMG} 
              src={(`${process.env.Storage_Url}/Servers/${this.props.Active.SID}/Icon`)} 
            />
          </picture>
          <h2 className={styles.Head}>{this.state.Active.Name}</h2>
        </div>
        <Messages SID={this.state.Active.SID} />
        <div></div>
        <Editor />
      </section>
    );
  }
}
export default Content;
